import React from "react";
import TaskBar from "@/components/organisms/TaskBar";
import { createApi } from "unsplash-js";

function unsplash() {
  const unsplash = createApi({
    accessKey: "DAQrUWKCxhZMjDH2S_X0sFv27A3OO0X3usud_ryy2CM",
  })

  const query = unsplash.search.getCollections({
    query: "hacker",
  })

  console.log(query)
}

function Home(): JSX.Element {
  unsplash()
  return <TaskBar />
}

export default Home;
